import styled from "styled-components";
import React from "react";
import "../../../App.css";
import { Link } from "react-router-dom";
function InNavbar() {
  return (
    <Container>
      <a>
        <h1>A. WorkSpace</h1>
      </a>
      <Menu>
        <Link to="">InMail</Link>
        <Link to="">ClassRoom</Link>
        <Link to="">Meetings</Link>
        <Link to="">ChitChat</Link>
        <Link to="">Thoughts</Link>
      </Menu>
    </Container>
  );
}
export default InNavbar;
